import React, { FC, useState } from 'react';
import { Button, Form, Input } from 'antd';
import Link from 'next/link';

export const LoginForm: FC = () => {
  const [form] = Form.useForm();

  console.log(form.getFieldValue('user-id'));

  return (
    <Form form={form}>
      <Form.Item
        label={'User-ID'}
        name='user-id'
        required>
        <Input />
      </Form.Item>
      <Form.Item
        label={'Password'}
        name='password'
        required>
        <Input />
      </Form.Item>
      <Form.Item>
        <Button
          type='primary'
          htmlType='submit'>
          Login
        </Button>
        <Link href='/signup'>
          <a>
            <Button>Sign up</Button>
          </a>
        </Link>
      </Form.Item>
    </Form>
  );
};
